import React from "react";
import "./styles.css";

const Cart = ({ cart }) => {
  return (
    <main className="cart">
      <h2>Your Cart</h2>
      {cart.length === 0 ? (
        <p>No items in your cart yet!</p>
      ) : (
        <ul>
          {cart.map((item, index) => (
            <li key={index}>
              <div className="cart-item">
                <img src={item.image} alt={item.name} />
                <div>
                  <h3>{item.name}</h3>
                  <p>{item.price}</p>
                </div>
              </div>
            </li>
          ))}
        </ul>
      )}
    </main>
  );
};

export default Cart;
